"use strict";
class VideoChatScheduled {
    constructor(data) {
        this.startedUnixTime = data.start_date;
    }
    get startedTimestamp() {
        return this.startedUnixTime * 1000;
    }
    get startedAt() {
        return new Date(this.startedTimestamp);
    }
}
module.exports = { VideoChatScheduled };
